import styled from 'styled-components'

export const StyledSearch = styled.section`

background-color: #F2F2F2;
display: flex;
justify-content: center;

.search{
    padding: 20px 10px 10px 10px;
}

input{
    width: 15rem;
    height: 20px;
    margin-right: 10px;
    border-radius: 14px;
    text-align: center;
}

button{
    border-radius: 15px;
    width: 4rem;
    height: 1.4rem;
    font-family: 'Poppins', sans-serif;
    font-weight: bold;


}

`
